import { Component, OnInit } from '@angular/core';
import { BestWinLoss } from '../types';
import { LeaderboardService } from '../leaderboard.service';

@Component({
  selector: 'app-q7',
  templateUrl: './q7.component.html',
  styleUrls: ['./q7.component.css']
})
export class Q7Component implements OnInit {
  BestWinLosses: BestWinLoss[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getWinLoss()
      .subscribe(BestWinLosses => this.BestWinLosses = BestWinLosses);
  }
}
